import React from "react";
import Customer from "./components/Customer";
import { Table, TableHead, TableBody, TableRow, TableCell } from '@mui/material';

const customers = [
  {
  'id': 1,
  'image': 'https://placeimg.com/64/64/any',
  'name': '백수정',
  'birthday': '961222',
  'gender': '남자',
  'job': '대학생'
},
{
  'id': 2,
  'image': 'https://placeimg.com/64/64/any',
  'name': '이도현',
  'birthday': '961222',
  'gender': '남자',
  'job': '대학생'
},
{
  'id': 3,
  'image': 'https://placeimg.com/64/64/any',
  'name': '백수정',
  'birthday': '961222',
  'gender': '남자',
  'job': '대학생'
},
]

function App() {
  return (
    <>
      <Table>
        <TableBody>
          {customers.map(c =>{
            return(
            <Customer
              key={c.id}
              id={c.id}
              image={c.image}
              name={c.name}
              birthday={c.birthday}
              gender={c.gender}
              job={c.job}
            />
            );})}
        </TableBody>
      </Table>

    </>

  );
}

export default App;
